ement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CJkCEM2rARgBIhMI6Inc1vHljwMV6wpxCh27XjKFygEEllGz2Q==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"01. Sin retorno 00:00\n02. Tiene que viajar! 05:47\n03. Charly 84 10:51\n04. Sol de clandestina 14:03\n05. Bromas aparte 19:58\n06. Mal parido 23:55\n07. Experiencias de nunca 29:04\n08. Yéndote al viento 34:27\n09. Joven regaladora 38:36\n10. La nueva voz 42:40\n11. Piel azteca 46:31\n12. El tiempo de los dones 53:50\n\nLETRAS: Federico Estigarrivia\n\nMÚSICA: Federico Mastronardi Pérez (Bebé Swedenborg)\n\nCoautoría en \"Tiene que viajar!\" con Federico Bardauil, Federico Estigarrivia y Martín Sus\n\nPRODUCCIÓN: Federico Mastronardi Pérez (Bebé Swedenborg)\n\nMEZCLA: temas 1,2, 3, 5, 6, 7, 9, 10 y 11 por Fred Lorca. Temas 4, 8 y 12 por Emiliano Benjamín\n\nMASTERIZACIÓN: Fred Lorca\n\nARTE DE TAPA: Eli Itovich\n\nFederico Mastronardi Pérez (Bebé Swedenborg): voces y guitarras en todos los temas, violines (3), bajos (12), coros (1, 3, 4, 5, 6, 8, 9, 10), teclados (10, 11), gritos (1), percusión (1, 10, 12), bandoneón (9), clarinetes (1, 2, 4, 5, 6, 7, 10). \n\nFederico Bardauil: guitarras en temas 3, 4, 6, 7 y 1, solo de guitarra (2, 6, 11 y 12), coros y charango (7), charango (6), gritos (1)\n\nEmiliano Benjamín: trombones en temas 1, 2, 4 y 11, percusión y marimba (4), percusión, contrabajo, guitarras, trompetas y trombones (8), piano y violines (12), guitarra wha wha (11)\n\nPablo Sebastián Ibáñez Ibarra: contrabajo en temas 1, 2 4, y 5\n\nLuz Nobili: piano en tema 8\n\nMartín Sus: guitarra acústica de 12 cuerdas y percusión en tema 2\n\nMatías Godoy: timbales, campanas, congas, shakers, chancha y acordeón en tema 5\n\nEli Itovich: coros en temas 3 y 11\n\nManuel Quiroga: bajo en tema 10\n\nTomás Viola: banjo en tema 1\n\nChristian Wehrli: congas en tema 10\n\nCamila Ayelén: voz en tema 5\n\nAño 2015","commandRuns":[{"startIndex":16,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJkCEM2rARgBIhMI6Inc1vHljwMV6wpxCh27XjKFygEEllGz2Q==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ygrC4cNyEEE","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ygrC4cNyEEE","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-ab5sznzk.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=ca0ac2e1c3721041\u0026ip=34.226.99.71\u0026mt=1758319709\u0026oweuc="}}}}}}},{"startIndex":44,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJkCEM2rARgBIhMI6Inc1vHljwMV6wpxCh27XjKFygEEllGz2Q==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ygrC4cNyEEE\u0026t=347s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ygrC4cNyEEE","continuePlayback":true,"startTimeSeconds":347,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-ab5sznzk.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=ca0ac2e1c3721041\u0026ip=34.226.99.71\u0026osts=347\u0026mt=1758319709\u0026oweuc="}}}}}}},{"startIndex":64,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CJkCEM2rARgBIhMI6Inc1vHljwMV6wpxCh27XjKFygEEllGz2Q==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ygrC4cNyEEE\u0026t=651s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ygrC4cNyEEE","continuePlayback":true,"startTimeSeconds":651,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOne gritos (1), percusión (1, 10, 12), bandoneón (9), clarinetes (1, 2, 4, 5, 6, 7, 10). \n\nFederico Bardauil: guitarras en temas 3, 4, 6, 7 y 1, solo de guitarra (2, 6, 11 y 12), coros y charango (7), charango (6), gritos (1)\n\nEmiliano Benjamín: trombones en temas 1, 2, 4 y 11, percusión y marimba (4), percusión, contrabajo, guitarras, trompetas y trombones (8), piano y violines (12), guitarra wha wha (11)\n\nPablo Sebastián Ibáñez Ibarra: contrabajo en temas 1, 2 4, y 5\n\nLuz Nobili: piano en tema 8\n\nMartín Sus: guitarra acústica de 12 cuerdas y percusión en tema 2\n\nMatías Godoy: timbales, campanas, congas, shakers, chancha y acordeón en tema 5\n\nEli Itovich: coros en temas 3 y 11\n\nManuel Quiroga: bajo en tema 10\n\nTomás Viola: banjo en tema 1\n\nChristian Wehrli: congas en tema 10\n\nCamila Ayelén: voz en tema 5\n\nAño 2015","commandRuns":[{"startIndex":16,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAUiEwjoidzW8eWPAxXrCnEKHbteMoXKAQSWUbPZ","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ygrC4cNyEEE","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ygrC4cNyEEE","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-ab5sznzk.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=ca0ac2e1c3721041\u0026ip=34.226.99.71\u0026mt=1758319709\u0026oweuc="}}}}}}},{"startIndex":44,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAUiEwjoidzW8eWPAxXrCnEKHbteMoXKAQSWUbPZ","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=ygrC4cNyEEE\u0026t=347s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"ygrC4cNyEEE","continuePlayback":true,"startTimeSeconds":347,"watchEndpointSupportedOnesieConfig":{"html
